import React from 'react';

import './DragDropComponent.scss';
import { isContinueStatement } from '@babel/types';

interface DragDropState {
    tasks: [{}];
}

class DragDropComponent extends React.Component<{}, DragDropState> {

    initState() {
        this.setState({
            tasks: [
                {name: "A", category: "wip", bgcolor: "yellow"}
            ]
        });
    }

    componentWillMount() {
        this.initState();
    }

    render() {
        return (
            <div className="container-drag">

            </div>
        );
    }
}

export default DragDropComponent;
